import 'dart:convert';
import 'dart:typed_data';

import 'package:flutter/material.dart';

/// Image of a cat.
///
/// Intended to by used only on [Routes.style] page.
class CatImage {
  /// [Size] of this [CatImage].
  static const Size size = Size(800, 600);

  /// Encoded image itself.
  static const String _catImage =
      '';

  /// Value of the [bytes], holding the decoded [_catImage].
  static Uint8List? _bytes;

  /// Returns the [Uint8List] of the image.
  static Uint8List get bytes => _bytes ??= base64Decode(_catImage);
}
